import React, { Component } from 'react';


class Geolocalizacao extends React.Component {

    constructor(props) {
        super(props);
    }


    render() {
        return (
            <div>
                <Map
                    google={this.props.google}
                    zoom={7}
                    initialCenter={{ lat: -27.0922364, lng: -52.6166878 }}
                >
                </Map>
            </div>
        );
    }
}

export default Geolocalizacao;
